import {Routes,Route  } from 'react-router-dom';
import Hero from './components/Hero';
import './App.css';
import Fullcard from './'



const App = () => {
  const data=[
    {
      title:"HTML",
      description:"this is html"
    },
    {
      title:"math",
      description:"this is math"
    },
    {
      title:"css",
      description:"this is css"
    },
    {
      title:"java",
      description:"this is java"
    },
    {
      title:"angular",
      description:"this is angular"
    },
    {
      title:"javascript",
      description:"this is javascript"
    }
  ]

  return (
   <Routes>
    <Route path="/" element={<Hero />}/>
    <Route path="/" element={<Fullcard />}/>
   </Routes>

    )
};


export default App;
